INSERT INTO `SCHEDULING_SPRINT` VALUES (1,NULL,'','','','',NULL,NULL,'CH03XC022','0.3333333333','12:20:00 PM',NULL,NULL,'Daron Sy','Vasudha Vanga','No Issue','0.0625','8:00:00 AM',NULL,NULL,'2019-09-17 00:00:00','',NULL,'','516265','Site was handoff to day shift Vasudha Vanga to continue with the migration. After the SW upgraded to 7.0.3 r-04 load, All the TDD cells went down after the activation .\nDiscovered MAU FW Package as not pushed during SW/FW activation.  FW/SW Verification showed OK but MAU FW was missing from deployed packages\nUpgraded FW/SW using latest MOP and MAU FW upgrade was successful\n7.0.3 > (FW 7.1.1 / SW 7.1.0) > MMIMO > SW 7.1.1\nRemoved SW/FW issue from issue tab.','','2:20:00 AM','','','',NULL,NULL,'Latoya','FECentral','',NULL,'','','CCSI','5:00:00 AM',NULL,'Chicago',NULL,'No Issue',NULL,'No',NULL,'No Issue','Central','Yes','',NULL,'2018-11-13 00:00:00','Migrated',NULL,'Hot Swap',NULL,NULL,NULL,'2019-04-05 18:51:05',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(2,NULL,'','','','',NULL,NULL,'CH03XC010','0.3125','12:00:00 PM',NULL,NULL,'Thang Pham','Vasudha Vanga','No Issue','0.0416666667','7:30:00 AM',NULL,NULL,'2019-09-17 00:00:00','',NULL,'','516260','','','1:45:00 AM','','','',NULL,NULL,'LaToya Norwood','FECentral','',NULL,'','','CCSI','5:45:00 AM',NULL,'Chicago',NULL,'No Issue',NULL,'No',NULL,'No Issue','Central','Yes','',NULL,'2018-11-15 00:00:00','Migrated',NULL,'Hot Swap',NULL,NULL,NULL,'2019-04-05 18:51:05',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(3,NULL,'','','','',NULL,NULL,'CH13XC048','0.3263888889','10:50:00 AM',NULL,NULL,'Matthew Hermez','Mark Serverson','No Issue','0.0416666667','7:50:00 AM',NULL,NULL,'2019-09-17 00:00:00','',NULL,'','516792','12/5)  Fix Scripts ran, and complete.','','1:09:00 AM','','','',NULL,NULL,'Raul Garcia','FECentral','',NULL,'','','CCSI','5:22:00 AM',NULL,'Chicago',NULL,'No Issue',NULL,'No',NULL,'No Issue','Central','Yes','',NULL,'2018-11-15 00:00:00','Migrated',NULL,'Hot Swap',NULL,NULL,NULL,'2019-04-05 18:51:05',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(4,NULL,'','','','',NULL,NULL,'CH03XC028','0.3333333333','12:00:00 PM',NULL,NULL,'Daron Sy','Vasudha Vanga','No','0','8:00:00 AM',NULL,NULL,'2019-09-17 00:00:00','',NULL,'','516267','Migration completed successfully, all sectors taking traffic. Pre-existing High temp alarm caused the DU to overheat resulting in complete outage. C&I opened TT. EMS was dispacted 11/19, high temp alarm resolved all site started taking traffic. Sprint is waiting on EAIU replacement - ETA 11/21.','','1:15:00 AM','','','',NULL,NULL,'Kyle Olejinzcak','FECentral','',NULL,'','','CCSI','5:00:00 AM',NULL,'Chicago',NULL,'Yes',NULL,'No',NULL,'Customer','Central','Yes','',NULL,'2018-11-16 00:00:00','Migrated',NULL,'Hot Swap',NULL,NULL,NULL,'2019-04-05 18:51:05',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(5,NULL,'','','','',NULL,NULL,'CH03XC244','0.3333333333','10:00:00 AM',NULL,NULL,'Daron Sy','Matthew Hermez','No Issue','0','8:00:00 AM',NULL,NULL,'2019-09-17 00:00:00','',NULL,'','516383','12/3)  FE returned to CH03XC244 to continue troubleshooting Beta sector. As part of troubleshooting the following was performed: \n1. Check SFP plugged into the Ports on the CDU30 (L6)  , cleaned and replaced.  \n2. Check fiber connections at CDU30 ( For Beta- Yellow cable from Bundle1) , tried swapping with spare cables\n3. Swapped the fiber connections between Alpha & Beta: We noticed Alpha came up on port6 and Beta was still down on port2 , which isolates the issue , issue with Fiber connections to HFC & to the MAU.\n3. Replaced with the spare CDU30 LCC Card\n4. Verified Site configuration, FW/SW loads and they are correct.\nNext Step is to have Tower Crew to revisit site to address. \n\nPre-existing - IND_MME_COMMUNICATION_FAIL (MME 9, 11, 12)','','1:00:00 AM','','','',NULL,NULL,'Mayowa Adeoye','FECentral','',NULL,'','','CCSI','5:00:00 AM',NULL,'Chicago',NULL,'N